import React, { useState } from 'react';
import { useSession } from '../session';
import { useNavigate } from 'react-router-dom';
const wilayaOptions = {
  "Adrar": 1,
  "Assaba": 2,
  "Brakna": 3,
  "Dakhlet Nouadhibou": 4,
  "Gorgol": 5,
  "Guidimaka": 6,
  "Hodh Ech Chargui": 7,
  "Hodh El Gharbi": 8,
  "Inchiri": 9,
  "Nouakchott-Nord": 10,
  "Nouakchott-Ouest": 11,
  "Nouakchott-Sud": 12,
  "Tagant": 13,
  "Tiris Zemmour": 14,
  "Trarza": 15
};

const typeSangOptions = {
  "A+": 1,
  "A-": 2,
  "B+": 3,
  "B-": 4,
  "AB+": 5,
  "AB-": 6,
  "O+": 7,
  "O-": 8
};

function SignUpForm() {
  const navigate = useNavigate();
  const {isLoggedIn} = useSession();
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    tel: '',
    username: '',
    email: '',
    wilaya: '',
    type_sang: '',
    password: '',
    password_confirm: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  if(isLoggedIn){
    navigate("/");
  }

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://127.0.0.1:8000/register/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });
  
      if (!response.ok) {
        // Si la réponse n'est pas OK, lancer une erreur avec le message d'erreur renvoyé par l'API
        const errorMessage = await response.text();
        throw new Error(errorMessage || 'Une erreur s\'est produite lors de l\'inscription.');
      }
  
      // Si la réponse est OK, rediriger l'utilisateur vers une autre page par exemple
      navigate("/", { replace: true });
      console.log('Utilisateur inscrit avec succès.');
      
      // Réinitialiser le formulaire après inscription réussie si nécessaire
    } catch (error) {
      console.error('Erreur lors de l\'inscription:', error.message);
      // Traitez l'erreur ici, par exemple, affichez un message d'erreur à l'utilisateur
    }
  };
  

  return (
    
    <div>
      <div>
        <h2>Inscription</h2>
        <form onSubmit={handleSubmit}>
          <div>
            <label for="first_name">Prénom</label>
            <input
              type="text"
              id="first_name"
              name="first_name"
              value={formData.first_name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="last_name">Nom de famille</label>
            <input
              type="text"
              id="last_name"
              name="last_name"
              value={formData.last_name}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="tel">Téléphone</label>
            <input
              type="tel"
              id="tel"
              name="tel"
              value={formData.tel}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="username">Nom d'utilisateur</label>
            <input
              type="text"
              id="username"
              name="username"
              value={formData.username}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label htmlFor="type_sang">Type de sang</label>
            <select
              id="type_sang"
              name="type_sang"
              value={formData.type_sang}
              onChange={handleChange}
              required
            >
              <option value="">Sélectionnez un type de sang</option>
              {Object.entries(typeSangOptions).map(([typeSang, value]) => (
                <option key={value} value={value}>{typeSang}</option>
              ))}
            </select>
          </div>

          <div>
            <label htmlFor="wilaya">Wilaya</label>
            <select
              id="wilaya"
              name="wilaya"
              value={formData.wilaya}
              onChange={handleChange}
              required
            >
              <option value="">Sélectionnez une wilaya</option>
              {Object.entries(wilayaOptions).map(([wilaya, value]) => (
                <option key={value} value={value}>{wilaya}</option>
              ))}
            </select>
          </div>

          <div>
            <label htmfor="password">Mot de passe</label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
          <div>
            <label for="password_confirm">Confirmer le mot de passe</label>
            <input
              type="password"
              id="password_confirm"
              name="password_confirm"
              value={formData.password_confirm}
              onChange={handleChange}
              required
            />
          </div>
          <button type="submit">S'inscrire</button>
        </form>
      </div>
    </div>

  );
}

export default SignUpForm;
